import React from "react";

class Valikot extends React.Component {
  constructor(props) {
    super(props);
    let maakunnatArr = this.props;
    this.state = {
      maakunnat: maakunnatArr,
    };

    this.maakunnatValikko = this.maakunnatValikko.bind(this);
  }

  maakunnatValikko() {
    console.log("maakunnat ennen looppia:", this.state.maakunnat);
    const options = Object.values(this.state.maakunnat).map((maakunta) => (
      <p>{maakunta}</p>
    ));

    console.log("options:", options);

    return <div>{options}</div>;
  }

  render() {
    return (
      <div>
        test
        {this.maakunnatValikko()}
      </div>
    );
  }
}

